const KEYS=require("./visitor-keys.json"),NODE_TYPES=Object.freeze(Object.keys(KEYS));for(const type of NODE_TYPES)Object.freeze(KEYS[type]);Object.freeze(KEYS);const KEY_BLACKLIST=new Set(["parent","leadingComments","trailingComments"]);function filterKey(key){return!KEY_BLACKLIST.has(key)&&"_"!==key[0]}module.exports=Object.freeze({KEYS:KEYS,getKeys:node=>Object.keys(node).filter(filterKey),unionWith(additionalKeys){const retv=Object.assign({},KEYS);for(const type of Object.keys(additionalKeys))if(retv.hasOwnProperty(type)){const keys=new Set(additionalKeys[type]);for(const key of retv[type])keys.add(key);retv[type]=Object.freeze(Array.from(keys))}else retv[type]=Object.freeze(Array.from(additionalKeys[type]));return Object.freeze(retv)}});